import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Axios from 'axios';
import Users from './components/Users';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Users List</h1>
        {this.state.user ? (
          <div>
            Name: {this.state.user.name}, <br /> Email: {this.state.user.email}
          </div>
        ) : null}
      </div>
    );
  }
}

export default App;
